// test data

export const PARTS = [
    {
      partNumber: 'PS11752778',
      name: 'Refrigerator Door Gasket',
      applianceType: 'refrigerator',
      brand: 'Whirlpool',
      description: 'Helps seal the refrigerator door to keep cold air in.',
      imageUrl: 'https://via.placeholder.com/80x80?text=PS11752778',
      compatibleModels: ['WRS325FDAM04', 'WRT311FZDW00'],
      installSteps: [
        'Turn off power to the refrigerator.',
        'Open the door and gently pull off the old gasket starting from a corner.',
        'Align the new gasket and press it into the retaining channel all around the door.',
        'Check for gaps and adjust as needed.',
      ],
    },
    {
      partNumber: 'ICE-MAKER-ASSY',
      name: 'Ice Maker Assembly',
      applianceType: 'refrigerator',
      brand: 'Whirlpool',
      description: 'Replacement ice maker assembly for Whirlpool refrigerators.',
      imageUrl: 'https://via.placeholder.com/80x80?text=ICE+MAKER',
      compatibleModels: ['WRF560SEHZ00'],
    },
  ];

  export const MODELS = [
    {
      modelNumber: 'WDT780SAEM1',
      applianceType: 'dishwasher',
      brand: 'Whirlpool',
    },
    {
      modelNumber: 'WRF560SEHZ00',
      applianceType: 'refrigerator',
      brand: 'Whirlpool',
    },
  ];
